import React from "react";
import { StyleSheet, View } from "react-native";

import AppText from "../components/AppText";
import Screen from "../components/Screen";
import colors from "../config/colors";
import AppButton from "../components/AppButton";
import routes from "../navigation/routes";

function Home( { navigation } ){
	return (
    <Screen style={styles.screen}>
      <AppText style={styles.text}>Blank home page for now</AppText>
		<View style={styles.buttonContainer}>
      <ScrollView>
		  <AppButton
            title="Food Dyes"
            onPress={() => navigation.navigate(routes.DYES)}
          />
		  <AppButton
            title="Preservatives"
            onPress={() => navigation.navigate(routes.PRESERVATIVES)}
          />
      <AppButton
            title="Sugars"
            onPress={() => navigation.navigate(routes.SUGARS)}
          />
      <AppButton
            title="Vitamins"
            onPress={() => navigation.navigate(routes.VITAMINS)}
          />
      <AppButton
            title="Ingredient Budgets"
            onPress={() => navigation.navigate(routes.BUDGETS)}
          />
          </ScrollView>
	    </View>
    </Screen>
  );
}

const styles = StyleSheet.create({
  screen: {
    flex: 1,
    backgroundColor: colors.light,
    justifyContent: "center",
    alignItems: "center",
  },
   buttonContainer: {
    padding: 20,
    width: "100%",
	alignItems: "center",
  },
  text: {
	  color: colors.primary,
  },
});
export default Home;
